INSERT INTO `health_label_refrence` VALUES ('07a8483c-5a48-458f-b564-52d0ed6382e4','VEGETARIAN','vegetarian','No meat, poultry, or fish'),('0d5d313b-8eb5-48a4-bbe3-e6a6a3ae688f','EGG FREE','egg-free','No eggs or products containing eggs'),('1baf8347-2f66-4eb1-8236-f40c24f962f3','KIDNEY FRIENDLY','kidney-friendly','phosphorus less than 250 mg AND potassium less than 500 mg AND sodium less than 500 mg'),('1f1685d9-d615-4d84-8c3b-a8cca589963d','DASH','DASH','Dietary Approaches to Stop Hypertension diet'),('21651dc9-7a33-4f00-9222-882b388472a2','LOW SUGAR','low-sugar','No simple sugars ‚Äì glucose, dextrose, galactose, fructose, sucrose, lactose, maltose'),('2954ae8b-619f-4baf-86ba-6c5e62efd58e','PORK FREE','pork-free','Does not contain pork or derivatives'),('4f68714b-d2a0-4d0c-bc25-0c31e1400867','SHELLFISH FREE','shellfish-free','No shellfish or shellfish derivatives'),('51fbbd21-e4b5-4733-895a-be7cacff9aef','DAIRY FREE','dairy-free','No dairy; no lactose'),('5771c1fa-2965-4056-be18-0346458518ac','IMMUNO SUPPORTIVE','immuno-supportive','Recipes which fit a science-based approach to eating to strengthen the immune system'),('57d9d520-1062-4450-9fe2-0639212d6171','WHEAT FREE','wheat-free','No wheat, can have gluten though'),('5a61233d-2e3d-4271-ad82-eee61c4230fd','PESCATARIAN','pecatarian','Does not contain meat or meat based products, can contain dairy and fish'),('61aa8b06-cb17-4667-b3a3-f0d7a8e13f86','PALEO','paleo','Excludes what are perceived to be agricultural products; grains, legumes, dairy products, potatoes, refined salt, refined sugar, and processed oils'),('654e0c4a-802c-4635-9fef-a9cd90edee44','SESAME FREE','sesame-free','Does not contain sesame seed or derivatives'),('6a0bd4d6-8337-4dc7-b2f8-16569bddf297','MEDITERRANEAN','Mediterranean','Mediterranean diet'),('7a101500-bbfd-40cb-844b-fdf0574b41ad','CELERY FREE','celery-free','Does not contain celery or derivatives'),('7f44741c-f732-4178-aa05-8516148eab32','FODMAP FREE','fodmap-free','Does not contain FODMAP foods'),('7fcb2e87-287b-4c7b-9906-6c95253d7d3d','TREE NUT FREE','tree-nut-free','No tree nuts or products containing tree nuts'),('89304d41-9a83-4752-8f6f-36520dba7963','SULFITE FREE','sulfite-free','No Sulfites'),('90806848-f19b-44a4-bcc0-9c644c6c4629','LOW POTASSIUM','low-potassium','Less than 150mg per serving'),('91fc1599-62a7-4ca2-85d8-c319c0dcea44','MUSTARD FREE','mustard-free','Does not contain mustard or derivatives'),('95fa29fd-cf46-47ca-b3a0-cc8e9e9af1c9','PEANUT FREE','peanut-free','No peanuts or products containing peanuts'),('9749cc93-3ef3-4fda-b742-ea271332d65c','NO OIL ADDED','No-oil-added','No oil added except to what is contained in the basic ingredients'),('a8f135fd-9749-46d7-a63d-eef3faa09a7a','FISH FREE','fish-free','No fish or fish derivatives'),('b186eab6-1f00-4d5f-9957-0a4102593fc5','ALCOHOL FREE','alcohol-free','No alcohol used or contained'),('b60ef886-3e85-4a1f-97d8-fcaa5fd76193','GLUTEN FREE','gluten-free','No ingredients containing gluten'),('bf257f69-0eae-47bb-881a-7a3d116daed6','RED MEAT FREE','red-meat-free','Does not contain beef, lamb, pork, duck, goose, game, horse, and other types of red meat or products containing red meat.'),('cc9d0e41-b454-4662-823e-a63e861f9073','KETO FRIENDLY','keto-friendly','Maximum 7 grams of net carbs per serving'),('d2555004-8e28-475c-99d0-e716d492142e','SOY FREE','soy-free','No soy or products containing soy'),('e11ffabb-ac53-4600-8cf9-4c63bab8b765','ALCOHOL COCKTAIL','alcohol-cocktail','Describes an alcoholic cocktail'),('e17a700a-0c16-4349-8e73-139a76366d5b','VEGAN','vegan','No meat, poultry, fish, dairy, eggs or honey'),('e54a22eb-69e6-49e0-9c55-07559727a5d9','KOSHER','kosher','Contains only ingredients allowed by the kosher diet. However it does not guarantee kosher preparation of the ingredients themselves'),('e7f4b62b-adc7-4d25-89b8-d99f3d77bc7c','MOLLUSK FREE','mollusk-free','No mollusks'),('eca0b699-7995-4cd7-9569-3f80d8454d17','SUGAR CONSCIOUS','sugar-conscious','Less than 4g of sugar per serving'),('f324794a-e469-48fe-a898-86fbe29feffd','LUPINE FREE','lupine-free','Does not contain lupine or derivatives'),('f93d1034-4147-482c-a332-6e75b679aad5','CRUSTCEAN FREE','crustacean-free','Does not contain crustaceans (shrimp, lobster etc.) or derivatives');
