INSERT INTO `instructions` VALUES ('148a6b40-5cf4-44ca-8d16-fde053e19dcc','Preheat oven to 400¬∞. Toss strawberries with sugar and a pinch of salt on a parchment-lined rimmed baking sheet. Let sit, tossing occasionally, until sugar dissolves, about 5 minutes. Roast, tossing halfway through, until strawberries are soft and release their juices, 20‚Äì25 minutes. Let cool.','2022-05-28 03:20:52.464721','f49aca18-7c3a-4eb9-850e-5295ecc69a93',1),('14bddc95-353c-4a27-811b-bd41dfc8b353','Mix tomatoes, mozzarella, basil, 1 clove minced garlic, and 1 tablespoon olive oil in a bowl; toss to coat. Cover bowl and refrigerate.','2022-06-20 18:31:54.766248','6be4228a-6480-4110-8653-982ceb7f2865',1),('23e91842-3ba3-4263-ae53-0f1d248d6d89','Mix tomatoes, onion, cilantro, lemon juice, and jalapeno pepper into mashed avocado until well combined; season with salt and black pepper.','2022-06-05 23:08:22.847771','39f9256e-6092-4c56-a4eb-934ef2125f07',2),('2855637e-9671-4036-9c2e-877f4165b710','Combine the peanuts, butter and sugar; press onto the bottom and up the sides of a greased 9-inch pie plate. Cover and refrigerate for 15 minutes.','2022-06-19 18:32:10.444526','09ed5f45-5bb0-4d0d-8057-fc164271233c',1),('2c25d9f3-1283-4fbb-9036-e6c2bdcaf4ca','Stud the ham with cloves and place on pan.','2022-06-19 18:35:09.453738','458f9b70-b1c3-4c1f-b4b6-343ed3d4a6d7',2),('2dda266e-11ea-43d7-ab36-5cce3c26e3c6','Divide smoothies and strawberries among glasses and top with sesame seeds, if using.','2022-05-30 22:30:10.872253','017b9644-3cb9-4388-8359-2c356c787ba9',3),('3a5a45cd-f359-4cff-9dd3-78ad73dd2c99','Preheat an outdoor grill for medium-high heat and lightly oil the grate.','2022-06-20 18:31:58.821520','6be4228a-6480-4110-8653-982ceb7f2865',2),('3bc6a756-75f5-40cd-87d7-7ea46b7221b5','Place steak in a large resealable bag; add 1 clove minced garlic, 1 tablespoon olive oil, salt, and pepper. Seal the bag and distribute the oil mixture over the steak.','2022-06-20 18:32:02.064888','6be4228a-6480-4110-8653-982ceb7f2865',3),('4bbdaa08-ed96-4dd3-8bc8-300e788dd0ce','Divide smoothies and strawberries among glasses and top with sesame seeds, if using.','2022-05-28 23:52:55.857389','7782efc9-c625-49d9-84be-c634e27660d1',3),('55139e6e-5063-465c-8c23-245c1980f9dc','Combine corn syrup, honey, butter and brown sugar. Stir until smooth. Reduce heat to medium low.','2022-06-05 23:01:57.710563','59a7e595-d0b8-4e67-9d62-87209a1ab37b',4),('5e2d6f0c-508e-4255-8ef3-79f5a86c34be','Transfer three-quarters of strawberries to a blender. Add banana, buttermilk, tahini, and 1 cup ice; blend until smooth. Using a metal spoon, smash remaining strawberries to a jammy consistency.','2022-05-28 23:52:55.855469','7782efc9-c625-49d9-84be-c634e27660d1',2),('600c0aa5-8dec-4830-8aa6-ce33b717cd02','Stud the ham with cloves and place on pan.','2022-06-05 23:01:57.702733','59a7e595-d0b8-4e67-9d62-87209a1ab37b',2),('68269cb5-da5f-4010-9e8d-f00561def2d7','Mash avocados in a bowl until creamy.','2022-06-05 23:08:22.842455','39f9256e-6092-4c56-a4eb-934ef2125f07',1),('773080cc-a650-48f1-bcae-97499c2f535e','Brush glaze over the top of the ham (don‚Äôt worry about cloves moving). Bake 1 hour, brushing more glaze over the top every 15 minutes.','2022-06-19 18:35:09.461442','458f9b70-b1c3-4c1f-b4b6-343ed3d4a6d7',5),('8637361a-9ef8-4474-8a08-e493860e2676','Cover and freeze overnight or until firm. Just before serving, sprinkle with mini candy-coated chocolate pieces, if desired.','2022-06-19 18:32:10.451379','09ed5f45-5bb0-4d0d-8057-fc164271233c',3),('a91587b9-07fb-49eb-8916-95d16f7f7946','Divide lettuce onto 4 serving plates. Drizzle 1 1/2 teaspoons each balsamic vinegar and olive oil onto each lettuce portion. Divide steak and tomato mixture evenly between the salads.','2022-06-20 18:32:10.732630','6be4228a-6480-4110-8653-982ceb7f2865',5),('abad8f42-b474-4bec-a488-f2b790a1b567','Transfer three-quarters of strawberries to a blender. Add banana, buttermilk, tahini, and 1 cup ice; blend until smooth. Using a metal spoon, smash remaining strawberries to a jammy consistency.','2022-05-28 03:20:52.471196','f49aca18-7c3a-4eb9-850e-5295ecc69a93',2),('af327a42-f8d0-4f2c-8331-c5c9affb782c','Transfer three-quarters of strawberries to a blender. Add banana, buttermilk, tahini, and 1 cup ice; blend until smooth. Using a metal spoon, smash remaining strawberries to a jammy consistency.','2022-05-30 22:30:10.869957','017b9644-3cb9-4388-8359-2c356c787ba9',2),('c35e9be6-a3cb-4125-8d3b-066dc19d3c3a','Preheat oven to 400¬∞. Toss strawberries with sugar and a pinch of salt on a parchment-lined rimmed baking sheet. Let sit, tossing occasionally, until sugar dissolves, about 5 minutes. Roast, tossing halfway through, until strawberries are soft and release their juices, 20‚Äì25 minutes. Let cool.','2022-05-28 23:52:55.852740','7782efc9-c625-49d9-84be-c634e27660d1',1),('c778688d-152f-43b5-bfbd-5400a3680d1d','Brush glaze over the top of the ham (don‚Äôt worry about cloves moving). Bake 1 hour, brushing more glaze over the top every 15 minutes.','2022-06-05 23:01:57.714798','59a7e595-d0b8-4e67-9d62-87209a1ab37b',5),('ceda20a1-f346-498f-b9a5-24be1ab644ed','When the grill is preheated, cook steak to your desired degree of doneness, about 5 minutes per side for medium. An instant-read thermometer inserted into the center should read 140 degrees F (60 degrees C). Let stand for 5 minutes before thinly slicing across the grain.','2022-06-20 18:32:06.377335','6be4228a-6480-4110-8653-982ceb7f2865',4),('d1274a0f-5963-4d62-bf8d-ba42a84c91d6','Divide smoothies and strawberries among glasses and top with sesame seeds, if using.','2022-05-28 03:20:52.476433','f49aca18-7c3a-4eb9-850e-5295ecc69a93',3),('d81106f8-5344-467a-94aa-389c822f0aec','Create a double broiler using a pot of water and a pot that rests on top. Bring water to a boil over medium high.','2022-06-05 23:01:57.706247','59a7e595-d0b8-4e67-9d62-87209a1ab37b',3),('da5de759-e4e0-43f9-9214-b4af6d5f9541','Preheat oven to 325¬∞F. Line a pan with foil.','2022-06-05 23:01:57.698577','59a7e595-d0b8-4e67-9d62-87209a1ab37b',1),('e49716df-08eb-4d17-aaf6-4956702680f5','Create a double broiler using a pot of water and a pot that rests on top. Bring water to a boil over medium high.','2022-06-19 18:35:09.456025','458f9b70-b1c3-4c1f-b4b6-343ed3d4a6d7',3),('ec526529-0821-4c25-bcaa-d75f6943ccb0','Preheat oven to 400¬∞. Toss strawberries with sugar and a pinch of salt on a parchment-lined rimmed baking sheet. Let sit, tossing occasionally, until sugar dissolves, about 5 minutes. Roast, tossing halfway through, until strawberries are soft and release their juices, 20‚Äì25 minutes. Let cool.','2022-05-30 22:30:10.858195','017b9644-3cb9-4388-8359-2c356c787ba9',1),('ed093def-c9be-48e7-9982-472aebdb622b','In a large bowl, combine peanut butter and corn syrup. Add coconut and peanuts. Stir in ice cream just until combined. Spoon into crust.','2022-06-19 18:32:10.446944','09ed5f45-5bb0-4d0d-8057-fc164271233c',2),('f374a2a4-6f51-4aef-960e-ebc9004cb72a','Preheat oven to 325¬∞F. Line a pan with foil.','2022-06-19 18:35:09.451549','458f9b70-b1c3-4c1f-b4b6-343ed3d4a6d7',1),('f3cb6993-6705-4d29-9349-c7e9a5bb3252','Combine corn syrup, honey, butter and brown sugar. Stir until smooth. Reduce heat to medium low.','2022-06-19 18:35:09.459486','458f9b70-b1c3-4c1f-b4b6-343ed3d4a6d7',4);
