INSERT INTO `recipes` VALUES ('017b9644-3cb9-4388-8359-2c356c787ba9','Roasted Strawberry and Tahini Buttermilk Shake',2,'Roasted_Strawberry_and_Tahini_Buttermilk_Shake_1653946210800.jpg','','','','https://www.bonappetit.com/recipe/roasted-strawberry-and-tahini-buttermilk-shake',1,'2022-05-30 22:30:10.827040','Using bruised berries, that last little bit of buttermilk in the container, and a scoop of tahini will make you feel both resourceful and well fed.'),('09ed5f45-5bb0-4d0d-8057-fc164271233c','Peanutty Ice Cream Pie',8,'Peanutty_Ice_Cream_Pie_1655659930366.jpg','','25 mins ','1 day 40 mins ','https://www.allrecipes.com/recipe/12303/peanutty-ice-cream-pie/',1,'2022-06-19 18:32:10.388909','Softened vanilla ice cream is mixed with coconut and chopped peanuts and spread into a chopped peanut crust, then frozen until firm for a rich and creamy dessert pie. Top with M&Ms&reg;, sprinkles, toasted coconut, or chocolate shavings before serving.'),('39f9256e-6092-4c56-a4eb-934ef2125f07','Traditional Mexican Guacamole',4,'Traditional_Mexican_Guacamole_1654466902807.jpg','','10 mins ','10 mins ','https://www.allrecipes.com/recipe/221286/traditional-mexican-guacamole/',1,'2022-06-05 23:08:22.813746','This guacamole uses the traditional ingredients of avocado, lemon juice, cilantro, and onion. Spice it up with jalapeno pepper if you like!'),('458f9b70-b1c3-4c1f-b4b6-343ed3d4a6d7','Honey Glazed Ham',18,'Honey_Glazed_Ham_1655660109394.jpg','1 hr','10 mins','1 hr 10 mins','https://julieblanner.com/honey-glazed-ham/',1,'2022-06-19 18:35:09.424735','This Honey Glazed Ham will be the star of your table! A holiday favorite, wow your guests with this sweet and savory Easy Honey Ham Recipe.'),('59a7e595-d0b8-4e67-9d62-87209a1ab37b','Honey Glazed Ham',18,'Honey_Glazed_Ham_1654466517638.jpg','1 hr','10 mins','1 hr 10 mins','https://julieblanner.com/honey-glazed-ham-old/',1,'2022-06-05 23:01:57.648032','This Honey Glazed Ham will be the star of your table! A holiday favorite, wow your guests with this sweet and savory Easy Honey Ham Recipe.'),('6be4228a-6480-4110-8653-982ceb7f2865','Caprese Salad with Grilled Flank Steak',4,'Caprese_Salad_with_Grilled_Flank_Steak_1655746268366.jpg','10 mins ','20 mins ','35 mins ','https://www.allrecipes.com/recipe/232209/caprese-salad-with-grilled-flank-steak/',1,'2022-06-20 18:31:08.375895','Grilled, marinated flank steak tops a Caprese salad for delicious main course meal that\'s perfect for summer.'),('7782efc9-c625-49d9-84be-c634e27660d1','Roasted Strawberry and Tahini Buttermilk Shake',2,'Roasted_Strawberry_and_Tahini_Buttermilk_Shake_1653778375820.jpg','','','','https://www.bonappetit.com/recipe/roasted-strawberry-and-tahini-buttermilk-shake-old-old',0,'2022-05-28 23:52:55.830040','Using bruised berries, that last little bit of buttermilk in the container, and a scoop of tahini will make you feel both resourceful and well fed.'),('f49aca18-7c3a-4eb9-850e-5295ecc69a93','Roasted Strawberry and Tahini Buttermilk Shake',2,'Roasted_Strawberry_and_Tahini_Buttermilk_Shake_1653704451180.jpg','','','','https://www.bonappetit.com/recipe/roasted-strawberry-and-tahini-buttermilk-shake-old',0,'2022-05-28 03:20:51.190167','Using bruised berries, that last little bit of buttermilk in the container, and a scoop of tahini will make you feel both resourceful and well fed.');
